import axios from 'axios';
// process.env.REACT_APP_BE_URL

const instance = axios.create({
    baseURL: "https://jsonplaceholder.typicode.com/"
})

axios.get("todos/1")
.then((res)=>{
    console.log(res)
})
.catch((err)=>{
    console.log(res)
})
const login = () => {
    console.log(baseURL)
}

export {login}
console.log(baseURL)
